import React from "react";

const UserResume = ({ resume }) => {
  const {
    first_name,
    last_name,
    phone_number,
    address,
    designation,
    email,
    city,
    description,
  } = resume.about;
  return (
    <div className="flex justify-start w-[60%]  items-start">
      <div className="flex bg-[#353535] text-white flex-col p-10 basis-[35%] ">
        <div className="underline">CONTACT</div>
        <div>{phone_number}</div>
        <div>{email}</div>
        <span>
          {address}
          {city}
        </span>
        <div className="underline">Education</div>
        <div>{phone_number}</div>
        <div>{email}</div>
        <span>
          {address}
          {city}
        </span>
      </div>
      <div className="flex flex-col basis-[65%] p-10 ">
        <div className="text-2xl flex">
          <div>{first_name}</div>
          <div>{last_name}</div>
        </div>
        <div>
          <div> {designation}</div>

          <div>{description}</div>
        </div>
      </div>
    </div>
  );
};

export default UserResume;
